    false,nt"url": null,nt"notes": " n        This evaluation focuses on the
    ITC (Community Land Fund) outcomes in two iTC/G6 provinces (Manica and Cabo Delgado)
    and one iTC/MCA province (Zambu00e9zia). The evaluator used what it called a 'Outcomes
    Harvesting' approach and method.  The evaluator identified program objectives and
    then sought to uncover or 'harvest' outcomes corresponding to specific, measurable
    changes in the behavior and relations of communities and their organizations, outcomes
    which the activities and interventions of KPMG and its service providers contributed
    to being realized. Overall, the evaluation harvested 171 outcomes, triangulated
    from multiple sources and found that iTC contributed to these successful outcomes
    at the community level.n      ",nt"license_title": "License Not Specified",nt"extras":
